  "manifest": {
    "version": 1,
    "install": {
      "jupyter": {
        "pkg-path": "jupyter-all"
      },
      "matplotlib": {
        "pkg-path": "python312Packages.matplotlib"
      },
      "numpy": {
        "pkg-path": "python312Packages.numpy"
      },
      "pandas": {
        "pkg-path": "python312Packages.pandas"
      },
      "plotly": {
        "pkg-path": "python312Packages.plotly"
      },
      "pyarrow": {
        "pkg-path": "python312Packages.pyarrow"
      },
      "pydot": {
        "pkg-path": "python312Packages.pydot"
      },
      "sympy": {
        "pkg-path": "python312Packages.sympy"
      },
      "toilet": {
        "pkg-path": "toilet"
      }
    },
    "vars": {
      "JUPYTER_SERVER_TOKEN": "floxfan123456",
      "PYTHON_ENV": "./nb-venv/"
    },
    "hook": {
      "on-activate": "  if [[ -d $PYTHON_ENV ]]; then\n    echo; echo -n \"‚ö°Ô∏è Activating existing venv in $PYTHON_ENV...\"\n    . $PYTHON_ENV/bin/activate\n    echo \"done.\"\n  fi\n\n  # If we see a requirements.txt file, install its contents\n  # into a virtual environment\n\n  if [[ -f requirements.txt ]]; then\n    echo -n \"üêç Processing requirements.txt...\"\n    [ ! -d $PYTHON_ENV ] && python -m venv $PYTHON_ENV\n    . $PYTHON_ENV/bin/activate\n    pip3 -qq install -r requirements.txt\n    echo \"done.\"\n  fi\n"
    },
    "profile": {
      "common": "  toilet -f smmono9 --metal \"jupyter\"\n\n  echo\n  if [[ \"$FLOX_ACTIVATE_START_SERVICES\" == \"true\" ]]; then\n    sleep 1\n    jupyter-notebook list\n  else\n    echo \"To start notebook server, run activate with '--start-services'.\"\n  fi\n  echo\n"
    },
    "options": {
      "systems": [
        "x86_64-linux",
        "aarch64-darwin",
        "aarch64-linux",
        "x86_64-darwin"
      ],
      "allow": {
        "licenses": []
      },
      "semver": {}
    },
    "services": {
      "jupyter-server": {
        "command": "jupyter-notebook --no-browser --IdentityProvider.token=${JUPYTER_SERVER_TOKEN} --ip=0.0.0.0"
      }
    }
  },
